const projects = 
[{
    title: "DealMtrx(PE Connection Inc.)",
    description: "At the private equity company we are building a software product DealMtrx to simplify the process for Borrowers to grow and manage Lender relationships. . As a team member, I am responsible for managing the Front-end part of the product and determine the structure and design of web pages. Building responsive web designs, UI using ReactJS, HTML5 grid layout, CSS3 media queries"
},
{
    title:"Snapeda CAD model",
    description: <div>
        <a href="https://shruti-test.herokuapp.com/">https://shruti-test.herokuapp.com/</a>As a freelancer I developed the front-end for the 'one-for-all' SnapeEDA model to be implemented in their partners' websites via a <script/> using Google Tag Manager.\n I developed it in a way that it can be used by any or all future partners' of SnapEDA without any modifications Original SnapEDA website:\nhttps://www.snapeda.com/\n Current partner using this embed:\nhttps://www.rs-online.com/designspark/snapeda-parts-finder\n https://www.electronics-lab.com/snapeda-cad-models/?/#/`
    </div>
}
]
export default projects;
